 na entrega e pela facilidade em preço e formas de pagamento.\r\n\r\nContamos com uma equipe altamente qualificada e uma estrutura moderna, prontos para atender veículos de todas as marcas. Venha conhecer o Cordeiro Via Sul. Aqui cuidamos bem do seu veículo. Conheça nossos serviços.\r\n<h5>Visão:</h5>\r\nValorizar os clientes ao oferecer produtos e serviços que preservem a segurança dos veículos e o bem estar dos usuários. De maneira a gerar oportunidade de desenvolvimento técnico e humano aos colaboradores. Com o intuito de transformar nossos esforços em atuação útil e proveitosa à nossa equipe, aos nossos clientes e à sociedade.\r\n<h5>Nossa missão é:</h5>\r\nTornar-se uma rede de oficinas automotivas no Ceará líder em qualidade, atendimento e satisfação do cliente.\";s:10:\"post_title\";s:10:\"Quem somos\";s:12:\"post_excerpt\";s:0:\"\";s:11:\"post_status\";s:7:\"publish\";s:14:\"comment_status\";s:6:\"closed\";s:11:\"ping_status\";s:6:\"closed\";s:13:\"post_password\";s:0:\"\";s:9:\"post_name\";s:10:\"quem-somos\";s:7:\"to_ping\";s:0:\"\";s:6:\"pinged\";s:0:\"\";s:13:\"post_modified\";s:19:\"2018-10-08 15:08:38\";s:17:\"post_modified_gmt\";s:19:\"2018-10-08 18:08:38\";s:21:\"post_content_filtered\";s:0:\"\";s:11:\"post_parent\";i:0;s:4:\"guid\";s:40:\"http://localhost/cordeirovs/?page_id=578\";s:10:\"menu_order\";i:0;s:9:\"post_type\";s:4:\"page\";s:14:\"post_mime_type\";s:0:\"\";s:13:\"comment_count\";s:1:\"0\";s:6:\"filter\";s:3:\"raw\";}i:5;O:7:\"WP_Post\":24:{s:2:\"ID\";i:580;s:11:\"post_author\";s:1:\"1\";s:9:\"post_date\";s:19:\"2018-09-27 15:14:30\";s:13:\"post_date_gmt\";s:19:\"2018-09-27 18:14:30\";s:12:\"post_content\";s:0:\"\";s:10:\"post_title\";s:9:\"Serviços\";s:12:\"post_excerpt\";s:0:\"\";s:11:\"post_status\";s:7:\"publish\";s:14:\"comment_status\";s:6:\"closed\";s:11:\"ping_status\";s:6:\"closed\";s:13:\"post_password\";s:0:\"\";s:9:\"post_name\";s:8:\"servicos\";s:7:\"to_ping\";s:0:\"\";s:6:\"pinged\";s:0:\"\";s:13:\"post_modified\";s:19:\"2018