(706, 1, '2018-10-10 15:19:39', '2018-10-10 18:19:39', 'Guia rápido ajuda a manter em ordem o veículo e garantir segurança, a manutenção do carro é uma tarefa considerada prazerosa por parte dos motoristas, mas um pesadelo para outros. O cuidado com o automóvel não é uma questão financeira... Leia [+]', 'Bateria, assoalho, fluido de freio etc. Já verificou esses itens hoje?', '', 'publish', 'closed', 'closed', '', 'itens-help', '', '', '2018-10-10 16:14:16', '2018-10-10 19:14:16', '', 0, 'http://localhost/cordeirovs/?post_type=dica&#038;p=706', 0, 'dica', '', 0),
